Here is a pseudo-code implementation of the Alexander polynomial algorithm for testing if the knot, represented in Gauss code, is equivalent to the unknot:
```javascript
function isKnotUnknot(gaussCode) {
  var n = gaussCode.length;
  var A = [1];
  for (var i = 0; i < n; i++) {
    var b = gaussCode[i];
    for (var j = 0; j < n; j++) {
      if (b == -1) {
        A[j] *= -1;
      }
    }
    A.push(b);
  }

  var det = A[0] * (A[n-1] - A[n-2]);
  for (var i = 1; i < n-1; i++) {
    det = det * (A[i] - A[i-1]) * (A[n-i] - A[n-i-1]);
  }

  return det != 0;
}
```

Using this function, we can test if the given gauss code represents the unknot by computing its Alexander polynomial and checking if it’s non-zero. If the function returns `true`, then the knot is equivalent to the unknot, otherwise it’s not.
